          val JsonResult = session("Body").as[String]
          print(s"Body $JsonResult")
          val empNo = new Regex("\'cp_empNo\':\'(|.+?)\'")
          val empId = new Regex("\'cp_lastValue\':\'(|.+?)\'")
          val locationId = new Regex("\'cp_LocationId\':\'(|.+?)\'")
          val effectivedate = new Regex("\'cp_EffectiveDate\':\'(|.+?)\'")
          val empNoValue = ((empNo.findAllIn(JsonResult)).mkString(",")).split(":")(1).replace("'", "")
          val empIdValue = ((empId.findAllIn(JsonResult)).mkString(",")).split(":")(1).replace("\'", "").toInt
          val locationIdValue = ((locationId.findAllIn(JsonResult)).mkString(",")).split(":")(1).replace("\'", "").toInt
          val effectivedateValue = ((effectivedate.findAllIn(JsonResult)).mkString(",")).split(":", 2)(1).replace("\'", "")
          println(s"Employee No : $empNoValue")
          println(s"Employee Id : $empIdValue")
          println(s"Location Id : $locationIdValue")
          println(s"Effective DAte : $effectivedateValue")
          session.set("EmployeeNo", empNoValue).set("EmployeeId", empIdValue).set("LocationId", locationIdValue).set("EffectiveDate", effectivedateValue).set("customerCode", "pnt")
        })
    }

